import Card from "./Card"
import image1 from "../Assets/u_poplloon_demo.jpg"
import image2 from "../Assets/Logo_demo.jpg"

const cardsData = [
    {
        id: 1,
        image: image1,
        primaryText: "Project Poplloon:"
    },

    {
        id: 2,
        image: image2,
        primaryText: "Mira Softworks Website:"
    },

    {
        id: 3,
        image: image2,
        primaryText: "Mira Softworks Website:"
    },
]

function CardLine({title, id, image, primaryText}) {
    return <div className="container d-flex justify-content-center align-items-center h-100 mt-5">
        <div className="row">
            <h1 className="mb-5">- {title} -</h1>
            {
                cardsData.map(cardDataSet => (
                    <div className="col-md-4" key={id}>
                        <Card image={image} primaryText={primaryText} />
                    </div>
                ))
            }
        </div>
    </div>
}

export default CardLine;
